import Menu from '../components/Menu';
import styles from './components/Produtos.module.css'

function Produtos() {
    return (
        <div>
            <Menu />
            <div className={styles.produtos}>
                <ul>
                    <li>
                        Teste
                    </li>
                </ul>
            </div>
        </div>
    );
}

export default Produtos
